JWT: Cookies not being set when server (localhost:3001/login) is not accessed directly (MERN)<p>So I am trying to create a token for authentication.</p>
<p><strong>Scenario 1:</strong>
When I am accessing my local server directly <strong>localhost:3001/login</strong> I was able to update/set cookies. Here's a snippet of my code:</p>
<pre><code>app.get('/login', async (req, res) =&gt; {
  const run_query = (username, password) =&gt; {
    UserModel.findOne({ username:username }, (e, obj) =&gt; {
      if(obj === null)
        res.send('no user')

      else if(e)
        res.send(obj)

      else {
        bcrypt.compare(password, obj.password, function(e, resp) {
          if(resp) {
            const accessToken = createTokens(obj)

            res.cookie(`access-token`, accessToken);
            res.send(obj)
          }
          else
            res.send('wrong password')
        })
      }
    })
  }
  run_query(req.body.username, req.body.password)
})
</code></pre>
<p><strong>Scenario 2:</strong>
When I am trying to access <strong>localhost:3001/login</strong> via axios.get on button click (React) I am able to run my query successfully and send the obj data of the user but it is not setting the cookie.</p>
<p>Here's how I access /login via React:</p>
<pre><code>  const login = async () =&gt; {
    try {

      const res = await axios.get('http://localhost:3001/login', {
        username: username,
        password: password
      })

      const loginTrue = (res) =&gt; {
        setLogged(true)
        console.log(res)
      }

      res.data === 'wrong password' ? alert('Wrong Password')
        : res.data === 'no user' ? alert('Username not Found')
        : res.data === 'empty' ? alert('Please Fill up all fields')
        : res.data._id !== undefined &amp;&amp; res.data._id !== '' ? loginTrue(res.data)
        : alert('Error: ' + res.data.Error)

    } catch (e) {
      console.log(e)
    }
  }
</code></pre>
<p><strong>Question:</strong></p>
<ul>
<li>Why am I only able to update my cookie when accessing localhost:3001/login directly?</li>
</ul>
<p>I must've missed something or did something wrong. Thanks!</p>

