Why the warning: Unknown event handler property `onSession` is displayed in React app?<p>I'm pretty new to React, I have an simple app where the user can login via modal window that is displayed when the button &quot;Login&quot; it's clicked. User data is stored in a MongoDB collection, to validate the email and password entered by the user in the modal window the app send a request to a service that returns the data of the logged user or nothig if any error happens. If the user exists, the id is stored in local storage, then it must be redirected to another page. The problem is that apparently the method 'onSession' does not exist thus generating the warning: &quot;Unknown property of the event handler <code>onSession</code>&quot;.</p>
<p>I have created three components: &quot;LoginForm.js&quot;, &quot;LoginModal.js&quot; and &quot;Menu.js&quot;. The first has the fields for the email and password and the validations for the login, the second has the properties of the modal window and the last one is for a navigation bar where the &quot;Login&quot; button is displayed.</p>
<p>LoginForm.js:</p>
<pre><code>import React from 'react';
import { Col, Row, Form, Stack, Button, Image } from 'react-bootstrap';
import LoginIMG from '../../../assets/login.png'
import './LoginForm.css';

class LoginForm extends React.Component{
    constructor(props) {
        super(props);
        this.state = {
           email: '',
           password: ''
        };
        this.handleChange = this.handleChange.bind(this);
        this.handleSubmit = this.handleSubmit.bind(this);
}

handleSubmit(event) {
    event.preventDefault();
    if(this.state.email === '' || this.state.password === '') {
        alert('You must fill all inputs');
    }else{
        fetch('http://localhost:8080/api/user/'+this.state.email+'/'+this.state.password)
        .then(res =&gt; res.json())
        .then(data =&gt; {
            if(data.id !== null) {
                localStorage.setItem('idUser', data.id);
                this.props.onHide();
                this.props.onSession();
            }else{
                alert('Wrong password or username');
            }
        });
    }
}

handleChange(event) {
    const target = event.target;
    const value = target.value;
    const name = target.name;
    this.setState({
        [name]: value
    });
}


render() {
    return (
        &lt;div className=&quot;form&quot;&gt;
            &lt;br /&gt;
            &lt;Row className=&quot;justify-content-md-center&quot;&gt;
                &lt;Form onSubmit={this.handleSubmit}&gt;
                    &lt;Stack gap={3}&gt;
                        &lt;Row className=&quot;justify-content-md-center&quot;&gt;
                            &lt;Col lg={6} md={4} className='text-center'&gt;
                                &lt;Image src={LoginIMG} className=&quot;avatar&quot; roundedCircle /&gt;
                            &lt;/Col&gt;
                        &lt;/Row&gt;
                        &lt;Row className=&quot;justify-content-md-center&quot;&gt;
                            &lt;Col lg={6}&gt;
                                &lt;Form.Group controlId=&quot;formEmail&quot;&gt;
                                    &lt;Form.Label&gt;Email&lt;/Form.Label&gt;
                                    &lt;Form.Control type=&quot;email&quot; name=&quot;email&quot; value={this.state.email} onChange={this.handleChange} placeholder=&quot;Enter email&quot; /&gt;
                                &lt;/Form.Group&gt;
                            &lt;/Col&gt;
                        &lt;/Row&gt;
                        &lt;Row className=&quot;justify-content-md-center&quot;&gt;
                            &lt;Col lg={6}&gt;
                                &lt;Form.Group controlId=&quot;formPassword&quot;&gt;
                                    &lt;Form.Label&gt;Password&lt;/Form.Label&gt;
                                    &lt;Form.Control type=&quot;password&quot; name=&quot;password&quot; value={this.state.password} onChange={this.handleChange} /&gt;
                                &lt;/Form.Group&gt;
                            &lt;/Col&gt;
                        &lt;/Row&gt;
                        &lt;Row className=&quot;justify-content-md-center&quot;&gt;
                            &lt;Col lg={6} className=&quot;d-grid gap-2&quot;&gt;
                                &lt;Button type=&quot;submit&quot; variant=&quot;success&quot; size=&quot;lg&quot;&gt;Login&lt;/Button&gt;
                            &lt;/Col&gt;
                        &lt;/Row&gt;
                    &lt;/Stack&gt;
                &lt;/Form&gt;
            &lt;/Row&gt;
        &lt;/div&gt;
    );
  }
}

export default LoginForm;
</code></pre>
<p>LoginModal.js:</p>
<pre><code>import LoginForm from '../../forms/loginForm/LoginForm'
import { Modal } from 'react-bootstrap'; 
import './LoginModal.css';

function LoginModal(props){
   return (
       &lt;Modal {...props} size=&quot;lg&quot; aria-labelledby=&quot;contained-modal-title-vcenter&quot; centered&gt;
           &lt;Modal.Header closeButton&gt;
              &lt;Modal.Title id=&quot;contained-modal-title-vcenter&quot;&gt;
                 {props.title}
              &lt;/Modal.Title&gt;
           &lt;/Modal.Header&gt;
           &lt;Modal.Body&gt;
               &lt;LoginForm onHide={props.onHide} /&gt;
           &lt;/Modal.Body&gt;
        &lt;Modal.Footer&gt;
            {/* &lt;Button onClick={props.onHide}&gt;Close&lt;/Button&gt; */}
        &lt;/Modal.Footer&gt;
    &lt;/Modal&gt;
   );
}

export default LoginModal;
</code></pre>
<p>Menu.js:</p>
<pre><code>import React from 'react';
import {Navbar, Nav, Container} from 'react-bootstrap';
import { Link } from &quot;react-router-dom&quot;;
import LoginModal from '../../modals/loginModal/LoginModal';
import { useState } from 'react';


function Menu(){
    const [modalShow, setModalShow] = useState(false);
    const [idUser, setIdUser] = useState(0);

    const setSession = () =&gt; {
        if(localStorage.getItem('idUser') != null){
           setIdUser(localStorage.getItem('idUser'));
           console.log(idUser);
        }
    }

return(
    &lt;&gt;
        &lt;Navbar bg=&quot;dark&quot; expand=&quot;lg&quot; variant=&quot;dark&quot;&gt;
            &lt;Container&gt;
                &lt;Link className='navbar-brand' to=&quot;/&quot;&gt;Divina Comedia&lt;/Link&gt;
                &lt;Navbar.Toggle aria-controls=&quot;basic-navbar-nav&quot; /&gt;
                &lt;Navbar.Collapse id=&quot;basic-navbar-nav&quot;&gt;
                    &lt;Nav className=&quot;me-auto&quot;&gt;
                        &lt;Link className='nav-link' to=&quot;/&quot;&gt;Home&lt;/Link&gt;
                        {idUser === 0 ? &lt;Nav.Link id=&quot;login&quot; onClick={() =&gt; setModalShow(true)}&gt;Login&lt;/Nav.Link&gt; : null }
                        {idUser !== 0 ? &lt;Link className='nav-link' to=&quot;/orders&quot;&gt;Orders&lt;/Link&gt; : null }
                    &lt;/Nav&gt;
                &lt;/Navbar.Collapse&gt;
            &lt;/Container&gt;
        &lt;/Navbar&gt;
        &lt;LoginModal show={modalShow} onHide={() =&gt; setModalShow(false)} onSession={() =&gt; setSession()} /&gt;
    &lt;/&gt;
   );
}

export default Menu;
</code></pre>
<p>I'm really don't know what is wrong, any help is appreciated.</p>

